Component({options:{addGlobalClass:!0,multipleSlots:!0,styleIsolation:"shared"},properties:{scene:{type:String,value:"page"},type:{type:String,value:"500"},height:{type:Number,value:-1},icon:{type:String,value:"./images/default.png"},text:{type:String,value:"服务出问题了，请稍后再试～"},traceId:{type:String,value:""},bgColor:{type:String,value:"#ffffff"},hasBtn:{type:Boolean,value:!0},btnText:{type:String,value:"再试一次"},btnEvent:{type:String,value:""},home:{type:String,value:""}},observers:{type(t){switch(t){case"404":this.setData({text:"访问地址不存在～",btnText:"进入首页"});break;case"403":this.setData({text:"没有访问权限哦～",btnText:"返回"});break;case"offline":this.setData({icon:"./images/offline.png",text:"网络连接失败～",btnText:"刷新"})}}},ready(){wx.getNetworkType({success:t=>{t=t.networkType;"offline"!==this.data.type&&"none"===t&&this.setData({icon:"./images/offline.png",text:"网络连接失败～",btnText:"刷新",btnEvent:""})}})},methods:{handleButton(){var t=getCurrentPages();const e=t[t.length-1];if(this.data.btnEvent)e[this.data.btnEvent]();else{var t=e.route,a=e.options;const s=[];for(const i in a)s.push(i+"="+a[i]);var n=s.join("&");"tab"===this.data.scene?wx.reLaunch({url:`/${t}?`+n}):this.data.home?wx.reLaunch({url:this.data.home}):wx.redirectTo({url:`/${t}?`+n})}}}});